import { createBrowserRouter, RouterProvider} from "react-router-dom";
import HomeScreen from "./screens/HomeScreen";

const router = createBrowserRouter([
  {
    path: "/",
    element: <HomeScreen />,
  },
]);

function App() {
  return (
    <BrowserRouter>
      <div>
        <header>
          <a href="/">Glitter</a>
        </header>
        <main>

          <Routes>
            <Route path="/" element={<HomeScreen />} />
          </Routes>

        </main>
      </div>
    </BrowserRouter>
  );
}

export default App;
